import React from 'react';
import {Home,SingleRoom,Rooms,Error} from './components';
import './App.css';

class App extends React.Component {
  render(){
    return (
         <div>
           <Home />
           <Rooms />
           <SingleRoom />
           <Error />
         </div>
      );
  }

}

export default App;
